     1→'use client';
     2→
     3→import { useState, useCallback, useEffect, Suspense } from 'react';
     4→import { useSearchParams } from 'next/navigation';
     5→import {
     6→  ThaiWatsuduInput,
     7→  CompetitorRetailer,
     8→} from '@/lib/types/manual-comparison';
     9→import {
    10→  ThaiWatsuduInputCard,
    11→  CompetitorInputCard,
    12→} from '@/components/comparison';
    13→import { ReviewConfirmPanel } from '@/components/comparison/ReviewConfirmPanel';
    14→import { AppleStyleComparisonTable } from '@/components/comparison/AppleStyleComparisonTable';
    15→import { StageIndicator } from '@/components/comparison/StageIndicator';
    16→import { CollapsibleStepCard } from '@/components/comparison/CollapsibleStepCard';
    17→import { Toast, ToastVariant } from '@/components/ui/Toast';
    18→import { LoadingOverlay } from '@/components/comparison/LoadingOverlay';
    19→import { MainLayout } from '@/components/layout/MainLayout';
    20→import { Plus, RotateCcw, ExternalLink } from 'lucide-react';
    21→import Link from 'next/link';
    22→import {
    23→  saveManualComparisonProduct,
    24→  ComparisonTableData,
    25→} from '@/lib/utils/manual-comparison-storage';
    26→
    27→// Stage type for the 3-stage flow
    28→type ComparisonStage = 'input' | 'review' | 'results';
    29→
    30→// Competitor entry structure
    31→interface CompetitorEntry {
    32→  id: string;
    33→  retailer: CompetitorRetailer | '';
    34→  url: string;
    35→}
    36→
    37→// Comparison product structure
    38→interface ComparisonProduct {
    39→  sku: string;
    40→  name: string;
    41→  price: number;
    42→  discountPercentage?: number;
    43→  unitPrice?: number;
    44→  imageUrl?: string;
    45→  productUrl: string;
    46→  brand?: string;
    47→  category?: string;
    48→  stockStatus?: string;
    49→  retailer: string;
    50→  retailerLogo?: string;
    51→}
    52→
    53→// Comparison response structure (same as ComparisonTableData)
    54→interface ComparisonResponse {
    55→  thaiWatsadu: ComparisonProduct;
    56→  competitors: ComparisonProduct[];
    57→}
    58→
    59→// Validation error types
    60→interface ValidationErrors {
    61→  thaiWatsadu?: {
    62→    sku?: string;
    63→    url?: string;
    64→  };
    65→  competitors?: Record<string, string>;
    66→  general?: string;
    67→}
    68→
    69→function ManualComparisonContent() {
    70→  const searchParams = useSearchParams();
    71→
    72→  // Stage management
    73→  const [stage, setStage] = useState<ComparisonStage>('input');
    74→
    75→  // Form state
    76→  const [thaiWatsuduInput, setThaiWatsuduInput] = useState<ThaiWatsuduInput>({
    77→    sku: '',
    78→    url: '',
    79→  });
    80→  const [competitorEntries, setCompetitorEntries] = useState<CompetitorEntry[]>([
    81→    { id: `competitor-${Date.now()}`, retailer: '', url: '' },
    82→  ]);
    83→
    84→  // Results state
    85→  const [comparisonData, setComparisonData] = useState<ComparisonResponse | null>(null);
    86→  const [savedProductId, setSavedProductId] = useState<string | null>(null);
    87→
    88→  // UI state
    89→  const [isSubmitting, setIsSubmitting] = useState(false);
    90→  const [errors, setErrors] = useState<ValidationErrors>({});
    91→  const [toast, setToast] = useState<{
    92→    isVisible: boolean;
    93→    message: string;
    94→    variant: ToastVariant;
    95→  }>({
    96→    isVisible: false,
    97→    message: '',
    98→    variant: 'success',
    99→  });
   100→
   101→  // Handle query parameters for pre-filling
   102→  useEffect(() => {
   103→    const sku = searchParams.get('sku');
   104→    const url = searchParams.get('url');
   105→    const productId = searchParams.get('productId');
   106→
   107→    if (sku || url) {
   108→      setThaiWatsuduInput((prev) => ({
   109→        ...prev,
   110→        ...(sku && { sku: sku }),
   111→        ...(url && { url: url }),
   112→      }));
   113→    }
   114→
   115→    // Store productId for potential future use (e.g., linking back or storing results)
   116→    if (productId) {
   117→      // You can use this productId later to save manual comparison results
   118→      console.log('Pre-filled from product:', productId);
   119→    }
   120→  }, [searchParams]);
   121→
   122→  // Add new competitor entry
   123→  const handleAddCompetitor = useCallback(() => {
   124→    const newEntry: CompetitorEntry = {
   125→      id: `competitor-${Date.now()}-${Math.random()}`,
   126→      retailer: '',
   127→      url: '',
   128→    };
   129→    setCompetitorEntries((prev) => [...prev, newEntry]);
   130→  }, []);
   131→
   132→  // Remove competitor entry
   133→  const handleRemoveCompetitor = useCallback((id: string) => {
   134→    setCompetitorEntries((prev) => prev.filter((entry) => entry.id !== id));
   135→  }, []);
   136→
   137→  // Update competitor retailer
   138→  const handleCompetitorRetailerChange = useCallback(
   139→    (id: string, retailer: CompetitorRetailer) => {
   140→      setCompetitorEntries((prev) =>
   141→        prev.map((entry) =>
   142→          entry.id === id ? { ...entry, retailer } : entry
   143→        )
   144→      );
   145→    },
   146→    []
   147→  );
   148→
   149→  // Update competitor URL
   150→  const handleCompetitorUrlChange = useCallback((id: string, url: string) => {
   151→    setCompetitorEntries((prev) =>
   152→      prev.map((entry) => (entry.id === id ? { ...entry, url } : entry))
   153→    );
   154→  }, []);
   155→
   156→  // Get list of used retailers
   157→  const getUsedRetailers = useCallback((): CompetitorRetailer[] => {
   158→    return competitorEntries
   159→      .map((entry) => entry.retailer)
   160→      .filter((retailer): retailer is CompetitorRetailer => retailer !== '');
   161→  }, [competitorEntries]);
   162→
   163→  // Validate input stage
   164→  const validateInputStage = useCallback((): boolean => {
   165→    const newErrors: ValidationErrors = {};
   166→
   167→    // Validate Thai Watsadu
   168→    if (!thaiWatsuduInput.sku.trim()) {
   169→      newErrors.thaiWatsadu = { ...newErrors.thaiWatsadu, sku: 'SKU is required' };
   170→    }
   171→    if (!thaiWatsuduInput.url.trim()) {
   172→      newErrors.thaiWatsadu = { ...newErrors.thaiWatsadu, url: 'URL is required' };
   173→    }
   174→
   175→    // Validate competitors
   176→    const competitorErrors: Record<string, string> = {};
   177→    let hasAtLeastOneCompetitor = false;
   178→
   179→    competitorEntries.forEach((entry) => {
   180→      if (entry.retailer && entry.url.trim()) {
   181→        hasAtLeastOneCompetitor = true;
   182→      }
   183→
   184→      if (entry.retailer && !entry.url.trim()) {
   185→        competitorErrors[entry.id] = 'URL is required';
   186→      }
   187→      if (!entry.retailer && entry.url.trim()) {
   188→        competitorErrors[entry.id] = 'Retailer selection is required';
   189→      }
   190→    });
   191→
   192→    if (!hasAtLeastOneCompetitor) {
   193→      newErrors.general = 'Please add at least one competitor with retailer and URL';
   194→    }
   195→
   196→    if (Object.keys(competitorErrors).length > 0) {
   197→      newErrors.competitors = competitorErrors;
   198→    }
   199→
   200→    setErrors(newErrors);
   201→    return Object.keys(newErrors).length === 0;
   202→  }, [thaiWatsuduInput, competitorEntries]);
   203→
   204→  // Handle Input -> Review transition
   205→  const handleGoToReview = useCallback(() => {
   206→    if (validateInputStage()) {
   207→      setStage('review');
   208→    }
   209→  }, [validateInputStage]);
   210→
   211→  // Handle Review -> Input (Edit)
   212→  const handleEditInputs = useCallback(() => {
   213→    setStage('input');
   214→  }, []);
   215→
   216→  // Handle Review -> Results (Submit)
   217→  const handleConfirmAndCompare = useCallback(async () => {
   218→    setIsSubmitting(true);
   219→    setErrors({});
   220→
   221→    try {
   222→      // Filter valid competitor entries
   223→      const validCompetitors = competitorEntries.filter(
   224→        (entry) => entry.retailer && entry.url.trim()
   225→      );
   226→
   227→      const response = await fetch('/api/comparison/manual', {
   228→        method: 'POST',
   229→        headers: {
   230→          'Content-Type': 'application/json',
   231→        },
   232→        body: JSON.stringify({
   233→          thaiWatsadu: thaiWatsuduInput,
   234→          competitors: validCompetitors.map((entry) => ({
   235→            retailer: entry.retailer,
   236→            url: entry.url,
   237→          })),
   238→        }),
   239→      });
   240→
   241→      if (!response.ok) {
   242→        throw new Error('Failed to process comparison');
   243→      }
   244→
   245→      const result: ComparisonResponse = await response.json();
   246→      setComparisonData(result);
   247→
   248→      // Save manual comparison product to localStorage
   249→      const productId = saveManualComparisonProduct(result as ComparisonTableData);
   250→      setSavedProductId(productId);
   251→
   252→      setStage('results');
   253→
   254→      setToast({
   255→        isVisible: true,
   256→        message: 'Comparison saved! View in Products page',
   257→        variant: 'success',
   258→      });
   259→    } catch (err) {
   260→      console.error('Error submitting comparison:', err);
   261→      setToast({
   262→        isVisible: true,
   263→        message: 'Failed to process comparison. Please try again.',
   264→        variant: 'error',
   265→      });
   266→      setErrors({ general: 'Failed to process comparison. Please try again.' });
   267→    } finally {
   268→      setIsSubmitting(false);
   269→    }
   270→  }, [thaiWatsuduInput, competitorEntries]);
   271→
   272→  // Start new comparison
   273→  const handleStartNewComparison = useCallback(() => {
   274→    setStage('input');
   275→    setThaiWatsuduInput({ sku: '', url: '' });
   276→    setCompetitorEntries([{ id: `competitor-${Date.now()}`, retailer: '', url: '' }]);
   277→    setComparisonData(null);
   278→    setErrors({});
   279→  }, []);
   280→
   281→  return (
   282→    <MainLayout>
   283→      <div className="space-y-6">
   284→        {/* Breadcrumb */}
   285→        <nav className="text-sm text-gray-500">
   286→          <span>Home</span>
   287→          <span className="mx-2">/</span>
   288→          <span className="font-medium text-gray-900">Manual Comparison</span>
   289→        </nav>
   290→
   291→        {/* Page Header */}
   292→        <div>
   293→          <h1 className="text-3xl font-bold text-gray-900">Manual Comparison</h1>
   294→          <p className="mt-1 text-gray-600">
   295→            Compare products across retailers with Apple-style elegance
   296→          </p>
   297→        </div>
   298→
   299→        {/* Stage Indicator */}
   300→        <StageIndicator currentStage={stage} />
   301→
   302→        {/* STAGE 1: INPUT */}
   303→        {stage === 'input' && (
   304→          <div className="mx-auto max-w-4xl space-y-8">
   305→            {/* Thai Watsadu Input */}
   306→            <div>
   307→              <div className="mb-4 flex items-center gap-3">
   308→                <div className="w-8 h-8 rounded-full bg-red-500 text-white flex items-center justify-center font-bold shadow-md">
   309→                  1
   310→                </div>
   311→                <h2 className="text-2xl font-bold text-gray-900">
   312→                  Thai Watsadu Product
   313→                </h2>
   314→              </div>
   315→              <p className="mb-4 text-sm text-gray-600">
   316→                Enter the details of the product you want to compare from Thai Watsadu
   317→              </p>
   318→              <ThaiWatsuduInputCard
   319→                value={thaiWatsuduInput}
   320→                onChange={setThaiWatsuduInput}
   321→                disabled={false}
   322→                errors={errors.thaiWatsadu}
   323→              />
   324→            </div>
   325→
   326→            {/* Competitor Inputs */}
   327→            <div>
   328→              <div className="mb-4 flex items-center gap-3">
   329→                <div className="w-8 h-8 rounded-full bg-cyan-500 text-white flex items-center justify-center font-bold shadow-md">
   330→                  2
   331→                </div>
   332→                <h2 className="text-2xl font-bold text-gray-900">
   333→                  Competitor Products
   334→                </h2>
   335→              </div>
   336→              <p className="mb-4 text-sm text-gray-600">
   337→                Add up to 5 competitor products to compare against
   338→              </p>
   339→              <div className="space-y-4">
   340→                {competitorEntries.map((entry) => (
   341→                  <CompetitorInputCard
   342→                    key={entry.id}
   343→                    id={entry.id}
   344→                    retailer={entry.retailer}
   345→                    url={entry.url}
   346→                    onRetailerChange={(retailer) =>
   347→                      handleCompetitorRetailerChange(entry.id, retailer)
   348→                    }
   349→                    onUrlChange={(url) => handleCompetitorUrlChange(entry.id, url)}
   350→                    onRemove={() => handleRemoveCompetitor(entry.id)}
   351→                    disabled={false}
   352→                    error={errors.competitors?.[entry.id]}
   353→                    usedRetailers={getUsedRetailers()}
   354→                  />
   355→                ))}
   356→
   357→                {/* Add Competitor Button */}
   358→                {competitorEntries.length < 5 ? (
   359→                  <button
   360→                    type="button"
   361→                    onClick={handleAddCompetitor}
   362→                    className="group flex w-full items-center justify-center gap-3 rounded-xl border-2 border-dashed border-cyan-400 bg-gradient-to-r from-cyan-50 to-cyan-100 px-6 py-5 text-cyan-700 transition-all duration-200 hover:border-cyan-500 hover:from-cyan-100 hover:to-cyan-200 hover:shadow-lg hover:scale-[1.02] active:scale-[0.98]"
   363→                  >
   364→                    <div className="rounded-full bg-cyan-500 p-1.5 group-hover:bg-cyan-600 transition-colors shadow-md">
   365→                      <Plus className="h-5 w-5 text-white" />
   366→                    </div>
   367→                    <span className="font-bold text-base">
   368→                      Add Competitor ({competitorEntries.length}/5)
   369→                    </span>
   370→                  </button>
   371→                ) : (
   372→                  <div className="flex w-full items-center justify-center gap-2 rounded-xl border-2 border-dashed border-gray-300 bg-gray-50 px-6 py-5 text-gray-400">
   373→                    <span className="font-semibold">Maximum competitors reached (5/5)</span>
   374→                  </div>
   375→                )}
   376→              </div>
   377→            </div>
   378→
   379→            {/* Error Message */}
   380→            {errors.general && (
   381→              <div className="rounded-xl border-2 border-red-300 bg-gradient-to-r from-red-50 to-red-100 p-5 shadow-md">
   382→                <div className="flex items-center gap-3">
   383→                  <div className="flex-shrink-0 w-10 h-10 rounded-full bg-red-500 flex items-center justify-center">
   384→                    <span className="text-white text-xl font-bold">!</span>
   385→                  </div>
   386→                  <div>
   387→                    <p className="text-sm font-bold text-red-800">Error</p>
   388→                    <p className="text-sm font-medium text-red-600">{errors.general}</p>
   389→                  </div>
   390→                </div>
   391→              </div>
   392→            )}
   393→
   394→            {/* Next Button */}
   395→            <div className="flex justify-end">
   396→              <button
   397→                type="button"
   398→                onClick={handleGoToReview}
   399→                className="rounded-xl bg-gradient-to-r from-cyan-500 to-blue-500 px-10 py-4 font-bold text-white text-lg shadow-lg transition-all hover:from-cyan-600 hover:to-blue-600 hover:shadow-xl hover:scale-105 active:scale-95"
   400→              >
   401→                Next: Review →
   402→              </button>
   403→            </div>
   404→          </div>
   405→        )}
   406→
   407→        {/* STAGE 2: REVIEW */}
   408→        {stage === 'review' && (
   409→          <div className="mx-auto max-w-4xl space-y-6">
   410→            {/* Collapsible Input Stage Summary */}
   411→            <CollapsibleStepCard
   412→              stepNumber={1}
   413→              stepTitle="Input Stage"
   414→              isCompleted={true}
   415→              isActive={false}
   416→              summaryContent={
   417→                <div className="text-sm text-gray-600 space-y-2">
   418→                  <div className="flex items-center gap-2">
   419→                    <span className="font-semibold text-gray-700">Thai Watsadu SKU:</span>
   420→                    <span className="font-mono bg-gray-100 px-2 py-0.5 rounded">
   421→                      {thaiWatsuduInput.sku}
   422→                    </span>
   423→                  </div>
   424→                  <div className="flex items-center gap-2">
   425→                    <span className="font-semibold text-gray-700">Competitors:</span>
   426→                    <span>
   427→                      {competitorEntries.filter((entry) => entry.retailer && entry.url.trim()).length} selected
   428→                    </span>
   429→                  </div>
   430→                </div>
   431→              }
   432→              onEdit={handleEditInputs}
   433→            >
   434→              {/* Full input content (shown when expanded) */}
   435→              <div className="space-y-4 text-sm text-gray-700">
   436→                <div>
   437→                  <h4 className="font-semibold text-gray-900 mb-2">Thai Watsadu Product</h4>
   438→                  <div className="space-y-1">
   439→                    <div className="flex items-center gap-2">
   440→                      <span className="text-gray-600">SKU:</span>
   441→                      <span className="font-mono bg-gray-50 px-2 py-0.5 rounded">{thaiWatsuduInput.sku}</span>
   442→                    </div>
   443→                    <div className="flex items-center gap-2">
   444→                      <span className="text-gray-600">URL:</span>
   445→                      <a
   446→                        href={thaiWatsuduInput.url}
   447→                        target="_blank"
   448→                        rel="noopener noreferrer"
   449→                        className="text-cyan-600 hover:text-cyan-700 hover:underline truncate max-w-md"
   450→                      >
   451→                        {thaiWatsuduInput.url}
   452→                      </a>
   453→                    </div>
   454→                  </div>
   455→                </div>
   456→                <div>
   457→                  <h4 className="font-semibold text-gray-900 mb-2">Competitor Products</h4>
   458→                  <div className="space-y-2">
   459→                    {competitorEntries
   460→                      .filter((entry) => entry.retailer && entry.url.trim())
   461→                      .map((entry, idx) => (
   462→                        <div key={entry.id} className="p-3 bg-gray-50 rounded-lg">
   463→                          <div className="flex items-center gap-2 mb-1">
   464→                            <span className="font-semibold text-gray-700">
   465→                              Competitor {idx + 1}:
   466→                            </span>
   467→                            <span className="px-2 py-0.5 bg-cyan-100 text-cyan-700 rounded text-xs font-medium">
   468→                              {entry.retailer}
   469→                            </span>
   470→                          </div>
   471→                          <a
   472→                            href={entry.url}
   473→                            target="_blank"
   474→                            rel="noopener noreferrer"
   475→                            className="text-cyan-600 hover:text-cyan-700 hover:underline text-xs truncate block"
   476→                          >
   477→                            {entry.url}
   478→                          </a>
   479→                        </div>
   480→                      ))}
   481→                  </div>
   482→                </div>
   483→              </div>
   484→            </CollapsibleStepCard>
   485→
   486→            {/* Review Confirm Panel */}
   487→            <ReviewConfirmPanel
   488→              thaiWatsuduInput={thaiWatsuduInput}
   489→              competitorEntries={competitorEntries.filter(
   490→                (entry) => entry.retailer && entry.url.trim()
   491→              ).map(entry => ({
   492→                id: entry.id,
   493→                retailer: entry.retailer as string,
   494→                url: entry.url
   495→              }))}
   496→              onEdit={handleEditInputs}
   497→              onConfirm={handleConfirmAndCompare}
   498→            />
   499→          </div>
   500→        )}
   501→
   502→        {/* STAGE 3: RESULTS */}
   503→        {stage === 'results' && comparisonData && (
   504→          <div className="space-y-6">
   505→            <AppleStyleComparisonTable
   506→              thaiWatsuduProduct={comparisonData.thaiWatsadu}
   507→              competitorProducts={comparisonData.competitors}
   508→            />
   509→
   510→            {/* Action Buttons */}
   511→            <div className="flex justify-center gap-4">
   512→              {savedProductId && (
   513→                <Link
   514→                  href="/products"
   515→                  className="flex items-center gap-2 rounded-lg bg-gradient-to-r from-cyan-500 to-blue-500 px-8 py-3 font-semibold text-white transition-all hover:from-cyan-600 hover:to-blue-600 hover:shadow-lg"
   516→                >
   517→                  <ExternalLink className="h-5 w-5" />
   518→                  View in Products
   519→                </Link>
   520→              )}
   521→              <button
   522→                type="button"
   523→                onClick={handleStartNewComparison}
   524→                className="flex items-center gap-2 rounded-lg border-2 border-gray-300 bg-white px-8 py-3 font-semibold text-gray-700 transition-colors hover:bg-gray-50"
   525→              >
   526→                <RotateCcw className="h-5 w-5" />
   527→                Start New Comparison
   528→              </button>
   529→            </div>
   530→          </div>
   531→        )}
   532→      </div>
   533→
   534→      {/* Loading Overlay */}
   535→      {isSubmitting && <LoadingOverlay message="Processing comparison..." />}
   536→
   537→      {/* Toast Notification */}
   538→      <Toast
   539→        message={toast.message}
   540→        variant={toast.variant}
   541→        isVisible={toast.isVisible}
   542→        onClose={() => setToast({ ...toast, isVisible: false })}
   543→      />
   544→    </MainLayout>
   545→  );
   546→}
   547→
   548→export default function ManualComparisonPage() {
   549→  return (
   550→    <Suspense fallback={
   551→      <MainLayout>
   552→        <div className="flex items-center justify-center min-h-screen">
   553→          <div className="text-center">
   554→            <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-cyan-500 mx-auto"></div>
   555→            <p className="mt-4 text-gray-600">Loading...</p>
   556→          </div>
   557→        </div>
   558→      </MainLayout>
   559→    }>
   560→      <ManualComparisonContent />
   561→    </Suspense>
   562→  );
   563→}
