     1→'use client';
     2→
     3→import { COMPETITORS, COMPETITOR_LIST } from '@/lib/constants/competitors';
     4→import { CompetitorRetailer } from '@/lib/types/manual-comparison';
     5→import { X, Check, Info } from 'lucide-react';
     6→import { Tooltip } from '@/components/ui/Tooltip';
     7→import Image from 'next/image';
     8→import { useState } from 'react';
     9→
    10→interface CompetitorInputCardProps {
    11→  id: string;
    12→  retailer: CompetitorRetailer | '';
    13→  url: string;
    14→  onRetailerChange: (retailer: CompetitorRetailer) => void;
    15→  onUrlChange: (url: string) => void;
    16→  onRemove: () => void;
    17→  disabled?: boolean;
    18→  error?: string;
    19→  usedRetailers?: CompetitorRetailer[];
    20→}
    21→
    22→export function CompetitorInputCard({
    23→  id,
    24→  retailer,
    25→  url,
    26→  onRetailerChange,
    27→  onUrlChange,
    28→  onRemove,
    29→  disabled = false,
    30→  error,
    31→  usedRetailers = [],
    32→}: CompetitorInputCardProps) {
    33→  const [showRetailerSelector, setShowRetailerSelector] = useState(!retailer);
    34→  const selectedCompetitor = retailer ? COMPETITORS[retailer] : null;
    35→  const borderColor = selectedCompetitor?.color || '#E5E7EB';
    36→  const isUrlValid = url.trim().length > 0 && url.startsWith('http');
    37→
    38→  return (
    39→    <div
    40→      className="overflow-hidden rounded-xl bg-white shadow-md transition-all hover:shadow-lg duration-200"
    41→      style={{ borderLeft: `6px solid ${borderColor}` }}
    42→    >
    43→      {/* Header */}
    44→      <div className="flex items-center justify-between border-b-2 border-gray-200 bg-gray-50 px-4 py-3">
    45→        <div className="flex items-center gap-2">
    46→          {selectedCompetitor?.logo && (
    47→            <Image
    48→              src={selectedCompetitor.logo}
    49→              alt={selectedCompetitor.name}
    50→              width={24}
    51→              height={24}
    52→              className="object-contain"
    53→            />
    54→          )}
    55→          <span className="text-sm font-bold text-gray-900">
    56→            {selectedCompetitor?.name || 'Competitor'}
    57→          </span>
    58→        </div>
    59→        <button
    60→          type="button"
    61→          onClick={onRemove}
    62→          disabled={disabled}
    63→          className="rounded p-1 text-gray-400 transition-colors hover:bg-red-50 hover:text-red-500 disabled:cursor-not-allowed"
    64→          aria-label="Remove competitor"
    65→        >
    66→          <X className="h-5 w-5" />
    67→        </button>
    68→      </div>
    69→
    70→      {/* Form Fields */}
    71→      <div className="space-y-4 p-4">
    72→        {/* Retailer Visual Selection */}
    73→        <div>
    74→          <div className="mb-3 flex items-center gap-2">
    75→            <label className="block text-sm font-semibold text-gray-900">
    76→              Select Retailer {!retailer && <span className="text-red-600">*</span>}
    77→            </label>
    78→            <Tooltip content="Choose which retailer you want to compare against" placement="right">
    79→              <Info className="w-4 h-4 text-gray-400 hover:text-gray-600 transition-colors" />
    80→            </Tooltip>
    81→          </div>
    82→
    83→          {/* Selected Retailer - Show when retailer is selected and not showing selector */}
    84→          {retailer && !showRetailerSelector && (
    85→            <button
    86→              type="button"
    87→              onClick={() => setShowRetailerSelector(true)}
    88→              disabled={disabled}
    89→              className="w-full group"
    90→            >
    91→              <div
    92→                className="rounded-lg border-2 p-4 transition-all duration-200 hover:shadow-md"
    93→                style={{
    94→                  borderColor: selectedCompetitor?.color,
    95→                  backgroundColor: `${selectedCompetitor?.color}10`
    96→                }}
    97→              >
    98→                <div className="flex items-center justify-between">
    99→                  <div className="flex items-center gap-3">
   100→                    {selectedCompetitor?.logo && (
   101→                      <Image
   102→                        src={selectedCompetitor.logo}
   103→                        alt={selectedCompetitor.name}
   104→                        width={32}
   105→                        height={32}
   106→                        className="object-contain"
   107→                      />
   108→                    )}
   109→                    <div className="text-left">
   110→                      <div className="font-bold text-gray-900">{selectedCompetitor?.name}</div>
   111→                      <div className="text-xs text-gray-600">{selectedCompetitor?.nameTh}</div>
   112→                    </div>
   113→                  </div>
   114→                  <span className="text-xs text-gray-500 group-hover:text-gray-700">Change</span>
   115→                </div>
   116→              </div>
   117→            </button>
   118→          )}
   119→
   120→          {/* Retailer Cards Grid - Show when no retailer selected or when changing */}
   121→          {(!retailer || showRetailerSelector) && (
   122→            <div className="grid grid-cols-1 md:grid-cols-2 gap-3">
   123→              {COMPETITOR_LIST.map((comp) => {
   124→                const isUsed = usedRetailers.includes(comp.id);
   125→                const isCurrentSelection = retailer === comp.id;
   126→                const isDisabled = (isUsed && !isCurrentSelection) || disabled;
   127→
   128→                return (
   129→                  <button
   130→                    key={comp.id}
   131→                    type="button"
   132→                    onClick={() => {
   133→                      if (!isDisabled) {
   134→                        onRetailerChange(comp.id as CompetitorRetailer);
   135→                        setShowRetailerSelector(false);
   136→                      }
   137→                    }}
   138→                    disabled={isDisabled}
   139→                    className={`
   140→                      relative rounded-lg border-2 p-4 text-left transition-all duration-200
   141→                      ${
   142→                        isCurrentSelection
   143→                          ? 'shadow-lg scale-105'
   144→                          : isDisabled
   145→                          ? 'opacity-50 cursor-not-allowed'
   146→                          : 'hover:shadow-md hover:scale-105 cursor-pointer'
   147→                      }
   148→                    `}
   149→                    style={{
   150→                      borderColor: isCurrentSelection ? comp.color : '#E5E7EB',
   151→                      backgroundColor: isCurrentSelection ? `${comp.color}10` : 'white',
   152→                      boxShadow: isCurrentSelection ? `0 0 0 4px ${comp.color}30` : undefined,
   153→                    }}
   154→                  >
   155→                    <div className="flex items-center gap-3">
