     5→
     6→interface CollapsibleStepCardProps {
     7→  stepNumber: number;
     8→  stepTitle: string;
     9→  isCompleted: boolean;
    10→  isActive: boolean;
    11→  children: ReactNode;
    12→  summaryContent?: ReactNode;
    13→  onEdit?: () => void;
    14→}
    15→
    16→export function CollapsibleStepCard({
    17→  stepNumber,
    18→  stepTitle,
    19→  isCompleted,
    20→  isActive,
    21→  children,
    22→  summaryContent,
    23→  onEdit,
    24→}: CollapsibleStepCardProps) {
    25→  const [isExpanded, setIsExpanded] = useState(isActive || !isCompleted);
    26→
    27→  // Auto-expand if active
    28→  if (isActive && !isExpanded) {
    29→    setIsExpanded(true);
    30→  }
    31→
    32→  const handleToggle = () => {
    33→    if (isCompleted && !isActive) {
    34→      setIsExpanded(!isExpanded);
    35→    }
    36→  };
    37→
    38→  const handleEdit = (e: React.MouseEvent) => {
    39→    e.stopPropagation();
    40→    if (onEdit) {
    41→      onEdit();
    42→    }
    43→  };
    44→
    45→  return (
    46→    <div
    47→      className={`
    48→        rounded-xl border-2 overflow-hidden transition-all duration-300
    49→        ${
    50→          isActive
    51→            ? 'border-cyan-500 shadow-lg ring-4 ring-cyan-100'
    52→            : isCompleted
    53→            ? 'border-gray-300 shadow-md hover:shadow-lg'
    54→            : 'border-gray-200 shadow-sm'
    55→        }
    56→      `}
    57→    >
    58→      {/* Card Header */}
    59→      <div
    60→        onClick={handleToggle}
    61→        className={`
    62→          flex items-center justify-between px-6 py-4 cursor-pointer transition-colors
    63→          ${
    64→            isActive
    65→              ? 'bg-gradient-to-r from-cyan-50 to-cyan-100'
    66→              : isCompleted
    67→              ? 'bg-gray-50 hover:bg-gray-100'
    68→              : 'bg-white'
    69→          }
    70→        `}
    71→      >
    72→        <div className="flex items-center gap-3">
    73→          {/* Step Number Badge */}
    74→          <div
    75→            className={`
    76→              w-8 h-8 rounded-full flex items-center justify-center font-bold text-sm
    77→              transition-colors
    78→              ${
    79→                isActive
    80→                  ? 'bg-cyan-500 text-white'
    81→                  : isCompleted
    82→                  ? 'bg-green-500 text-white'
    83→                  : 'bg-gray-300 text-gray-600'
    84→              }
    85→            `}
    86→          >
    87→            {stepNumber}
    88→          </div>
    89→
    90→          {/* Step Title */}
    91→          <h3
    92→            className={`
    93→              text-lg font-semibold transition-colors
    94→              ${
    95→                isActive
    96→                  ? 'text-cyan-700'
    97→                  : isCompleted
    98→                  ? 'text-gray-700'
    99→                  : 'text-gray-900'
   100→              }
   101→            `}
   102→          >
   103→            {stepTitle}
   104→          </h3>
   105→
   106→          {/* Completed Badge */}
   107→          {isCompleted && !isActive && (
   108→            <span className="px-2 py-1 text-xs font-medium text-green-700 bg-green-100 rounded-full">
   109→              Completed
   110→            </span>
   111→          )}
   112→        </div>
   113→
   114→        {/* Action Buttons */}
   115→        <div className="flex items-center gap-2">
   116→          {isCompleted && !isActive && onEdit && (
   117→            <button
   118→              onClick={handleEdit}
   119→              className="p-2 rounded-lg text-gray-500 hover:text-cyan-600 hover:bg-cyan-50 transition-colors"
   120→              aria-label="Edit this step"
   121→            >
   122→              <Edit2 className="w-4 h-4" />
   123→            </button>
   124→          )}
   125→
   126→          {isCompleted && !isActive && (
   127→            <button
   128→              onClick={handleToggle}
   129→              className="p-2 rounded-lg text-gray-500 hover:text-gray-700 hover:bg-gray-100 transition-colors"
   130→              aria-label={isExpanded ? 'Collapse' : 'Expand'}
   131→            >
   132→              <ChevronDown
   133→                className={`w-5 h-5 transition-transform duration-300 ${
   134→                  isExpanded ? 'rotate-180' : ''
   135→                }`}
   136→              />
   137→            </button>
   138→          )}
   139→        </div>
   140→      </div>
   141→
   142→      {/* Card Content */}
   143→      <div
   144→        className={`
   145→          transition-all duration-300 ease-in-out overflow-hidden
   146→          ${
   147→            isExpanded
   148→              ? 'max-h-[2000px] opacity-100'
   149→              : 'max-h-0 opacity-0'
   150→          }
   151→        `}
   152→      >
   153→        <div className="p-6 bg-white border-t-2 border-gray-100">
   154→          {isExpanded && (isActive || !summaryContent) ? children : summaryContent}
   155→        </div>
   156→      </div>
   157→
