'use client';

import React from 'react';
import Image from 'next/image';

interface Product {
  imageUrl?: string;
  name: string;
  retailer: string;
  retailerLogo?: string;
}

interface ComparisonStickyHeaderProps {
  thaiWatsuduProduct: Product;
  competitorProducts: Product[];
}

export function ComparisonStickyHeader({
  thaiWatsuduProduct,
  competitorProducts,
}: ComparisonStickyHeaderProps) {
  const renderProductColumn = (product: Product, index: number) => {
    return (
      <th
        key={index}
        className="min-w-[200px] border-b border-gray-300 bg-white px-6 py-4"
      >
        <div className="flex flex-col items-center gap-3">
          {/* Product Image */}
          {product.imageUrl ? (
            <div className="relative h-24 w-24">
              <Image
                src={product.imageUrl}
                alt={product.name}
                fill
                className="object-contain"
                sizes="96px"
              />
            </div>
          ) : (
            <div className="flex h-24 w-24 items-center justify-center rounded-lg bg-gray-100">
              <span className="text-xs text-gray-400">No image</span>
            </div>
          )}

          {/* Retailer Info */}
          <div className="text-center">
            {product.retailerLogo ? (
              <div className="mb-1 flex justify-center">
                <Image
                  src={product.retailerLogo}
                  alt={product.retailer}
                  width={80}
                  height={24}
                  className="object-contain"
                />
              </div>
            ) : (
              <div className="mb-1 text-sm font-semibold text-gray-900">
                {product.retailer}
              </div>
            )}
          </div>
        </div>
      </th>
    );
  };

  return (
    <thead className="sticky top-0 z-10 shadow-sm">
      <tr>
        {/* Empty corner cell */}
        <th className="sticky left-0 z-20 border-b border-gray-300 bg-gray-50 px-6 py-4 text-left text-sm font-semibold text-gray-700">
          Compare
        </th>

        {/* Thai Watsadu Column */}
        {renderProductColumn(
          {
            ...thaiWatsuduProduct,
            retailer: 'Thai Watsadu',
          },
          0
        )}

        {/* Competitor Columns */}
        {competitorProducts.map((product, index) =>
          renderProductColumn(product, index + 1)
        )}
      </tr>
    </thead>
  );
}
